import "./accueil.css"
import Data from "./data.js"

export default class Accueil extends Component{
    constructor(props){
        super(props);
        this.title = "Titre de la location"
    }

    render() {
        return (
        <div id="articles">
            <div id="article">
                <p id="article__title">{this.title}</p>
            </div>
        </div>
        )
    }
}
